export default function Projects() {
  return (
    <section>
      <h1 className="mb-3">Projects</h1>
      <p>
        Have a look below at some of the projects I have worked on!
      </p>


    <div className="d-flex flex-row flex-wrap">
        <ProjectList />

    </div>
    </section>
  );
}
